import Models
import UIKit

final class DreamsProvider {

    private var dreams: [Dream]

    init() {
        dreams = [
            .init(title: "See the Eiffel Tower", image: Self.makeImage()),
            .init(title: "Jump from a parachute", image: Self.makeImage()),
            .init(title: "Attend a Music Festival", image: Self.makeImage()),
            .init(title: "Get a Tattoo", image: Self.makeImage()),
            .init(title: "Fly in a Helicopter", image: Self.makeImage()),
            .init(title: "Learn Spanish", image: Self.makeImage()),
            .init(title: "Buy iPhone 15", image: Self.makeImage())
        ]
    }

    init(dreams: [Dream]) {
        self.dreams = dreams
    }

    func provide() -> [Dream] {
        dreams
    }

    func update(_ dreams: [Dream]) {
        self.dreams = dreams
    }

    // MOCK
    // swiftlint:disable line_length
    private static func makeImage() -> UIImage? {
        let data = Data(base64Encoded: "")
        return UIImage(data: data)
    }

}

private extension UIImage {
    convenience init?(data: Data?) {
        guard let data else { return nil }
        self.init(data: data)
    }
}
